import './App.css';
import AIToolList from './components/AIToolList';

function App() {
  return (
    <div className="App">
      <nav className="navbar">
        <h1>AI Tools App</h1>
        <button>Add Tool</button>
        <button>Manage Tools</button>
      </nav>
      <header className="App-header">
        <AIToolList />
      </header>
    </div>
  );
}

export default App;
